import star from './images/icon-star.svg'

function App() {
  const Btn = ({ num }) => {
    return <button className="text-gray-100 bg-gray-700 w-10 h-10 pt-1 rounded-full">{num}</button>
  }

  return (
    <div className="wrapper">
      <img className="bg-gray-600 p-1 rounded-full mt-2" src={star} alt='' />
      <h2 className="p-5">How did we do?</h2>
      <p>Please let us know how we did with your support request. All feedback is appreciated to help us improve our offering!</p>
      <ul className="grid grid-cols-5 mb-10">
        <li><Btn num={1} /></li>
        <li><Btn num={2} /></li>
        <li><Btn num={3} /></li>
        <li><Btn num={4} /></li>
        <li><Btn num={5} /></li>
      </ul>
      <button className="btn-submit uppercase">submit</button>
    </div>
  );
}

export default App;
